const CardView = (user, animalsList) => {
  const [ age, name, isActive, animals ]  = { ...user };
  const [ given, surname ] = { ...name };

  return (
    <div>
      <div>
        {animalsList}
      </div>
      <div>
        {given}
      </div>
      <div>
        {surname}
      </div>
      <div>
        {age}
      </div>
    </div>
  )
}

export default CardView;
